import React, { Component } from 'react';
import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'
import Form from 'react-bootstrap/Form'
import FormControl from 'react-bootstrap/FormControl'
import Button from 'react-bootstrap/Button'
import { Link } from 'react-router-dom';
//import { MDBCol, MDBInput } from "mdbreact";
import { MDBCol, MDBIcon } from "mdbreact";



class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {}
  }
  render() {
    return (
      <Navbar style={{width: '100%'}}>
        <Navbar.Brand href="#home"><img src={require('./images/logo.png')} style={{ width: '120px', height: '120px' }} /></Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link style={{border: '1px solid'}}><Link to='/'>Home</Link></Nav.Link>
            <Nav.Link><Link to='/products'>Products</Link></Nav.Link>
            <Nav.Link><Link to='/events'>Events</Link></Nav.Link>
            <Nav.Link><Link to='/jewelry-care'>Jewelry Care</Link></Nav.Link>
            <Nav.Link><Link to='/contact'>Contact US</Link></Nav.Link>

                      <div class="middle">
                          <a class="btn" href="#"> <i class="fab fa-facebook-f"></i> </a>
                          <a class="btn" href="#"> <i class="fab fa-twitter"></i> </a>
                          <a class="btn" href="#"> <i class="fab fa-google"></i> </a> 
                          <a class="btn" href="#"> <i class="fab fa-instagram"></i> </a> 
                      </div>

                      <MDBCol md="6">
                          <div className="input-group md-form form-sm form-1 pl-0">
                            <div className="input-group-prepend">
                              <span className="input-group-text purple lighten-3" id="basic-text1">
                                <MDBIcon className="text-white" background="green" icon="search" color="green"/>
                              </span>
                            </div>
                            <input className="form-control my-0 py-1" type="text" placeholder="Search" aria-label="Search" />
                          </div>
                    </MDBCol>
        </Nav>    
    </Navbar.Collapse>
   </Navbar>



    );
  }
}


export default Header;
